import React from 'react';
import { Link, useLocation } from 'react-router-dom';
import "./Menu.css"; 
import consulta from "./Imagens/consulta.png";
import financeiro from "./Imagens/Financeiro.png";
import formulario from "./Imagens/Formulario.png";
import paciente from "./Imagens/Paciente.png";
import imagem2 from "./Imagens/Pesquisa.png";
import { useNavigate } from "react-router-dom";
const Menu = () => {

  const location = useLocation();
  const navigate = useNavigate();

  
  function handleLogin() {
    // Lógica de autenticação do usuário aqui
    navigate("/");
  }

  return (
      <div className="menu-lateral">
        
        <h1 className="sidebar-title">MIND TRACKER</h1>

        <Link to="/Inicio" className={`menu-button ${location.pathname === '/Inicio' ? 'active' : ''}`}>
          <img src={consulta} alt="Descrição da imagem" style={{ maxWidth: '20%', verticalAlign: 'middle' }}/>Consultas</Link>

        <Link to="/Formularios" className={`menu-button ${location.pathname === '/Formularios' ? 'active' : ''}`}>
          <img src={formulario} alt="Descrição da imagem" style={{ maxWidth: '20%', verticalAlign: 'middle' }}/>Formulários</Link>

        <Link to="/Financeiro" className={`menu-button ${ location.pathname === '/Financeiro' ? 'active' : ''}`}>
          <img src={financeiro} alt="Descrição da imagem" style={{ maxWidth: '20%', verticalAlign: 'middle' }}/>Financeiro</Link>

        <Link to="/Pacientes" className={`menu-button ${location.pathname === '/Pacientes' ? 'active' : ''}`}>
          <img src={paciente} alt="Descrição da imagem" style={{ maxWidth: '20%', verticalAlign: 'middle' }}/>Pacientes</Link>
          <div className="Pesquisa">
        <button className="img2-button" onClick={handleLogin}>
                <img src={imagem2} alt="Descrição da imagem" />
            </button> 
        </div>
      </div>
      
  );
};

export default Menu;
